import React, { Component } from "react";
import "./SearchBar.css";

class SearchBar extends Component {
  state = {};

  search() {
    this.props.onSearch;
  }

  render() {
    return (
      <div className="SearchBar">
        <input placeholder="Enter A Song, Album, or Artist" />
        <a>SEARCH</a>
      </div>
    );
  }
}

export default SearchBar;
